import React from "react";
import logo from "./logo.svg";
import "./App.css";
import "materialize-css/dist/css/materialize.min.css";
import { BrowserRouter as Router, Route } from "react-router-dom";

class App extends React.Component {
  render() {
    return (
      <Router>
        <Route path="/">
          <>
            <WelcomeNav />
            <UploadForm />
            <Footer />
          </>
        </Route>
      </Router>
    );
  }
}

export default App;
